import React, {useState} from "react";

import "../ToDoList.css";

const ToDo = ({todo}) => {

  const [isOpen, setIsOpen] = useState(false);

  const openOrClose = () => {
    isOpen ? setIsOpen(false) : setIsOpen(true);
  }

  return (
    <div className={`Card ${isOpen ? 
      'Card' : todo.task==null ? 
        'Empty-Card' : 'Card'}`
    }>
      {isOpen ?
        <button className="Card-Button" onClick={openOrClose}> 
          {isOpen ? 'true' : 'false'} 
          {todo.task == null ? 'Untitled' : todo.task}    
        </button> :
        <input type="text" onSubmit={console.log("pizza butt")}>
        </input>

      }

    </div>

  );
};
